sys_variable_value.value:
(function parse(inputs, outputs) {
    var collectInstances = [];
    var item = JSON.parse(inputs.sourceItem);
    for (var i in item) {
        var extractInstances = item[i]['instances'];
        if (extractInstances != undefined) {
            extractInstances.forEach(function(instance) {
                var instanceName = instance["name"];
                var instanceObj = {"name":instanceName};
                collectInstances.push(instanceObj);
            });
        }
    }
    outputs.targetObject = {
        "instances": collectInstances
    }
})(inputs, outputs)

(function execute(inputs, outputs) {
    var gcc = new GoogleCloudComputeUtils();
    gcc.validateInputVariables(inputs, outputs);
    gcc.validateMandatoryVariables(inputs, ['projectid']);
    gcc.maptoOutputFromInput(inputs, outputs, []);
})(inputs, outputs);

